CREATE DEFINER=`root`@`localhost` PROCEDURE `isitime` (IN `waktuMulai` DATE, IN `waktuSelesai` DATE, IN `HariJawa` VARCHAR(20), IN `HariIndo` VARCHAR(20))   begin
	

    -- Label untuk loop
    mulaiLoop: LOOP

        -- Memasukkan data ke dalam tabel dimtime
        VALUES (
            YEAR(waktuMulai), 
            MONTH(waktuMulai), 
            DAY(waktuMulai),
            waktuMulai,
            DAYNAME(waktuMulai), 
            HariIndo,  
            HariJawa
        );

        -- Menambah satu hari ke waktuMulai
        SET waktuMulai = DATE_ADD(waktuMulai, INTERVAL 1 DAY);

        -- Mengubah HariJawa berdasarkan siklus 5 hari
        SET HariJawa = 
            CASE
                WHEN HariJawa = 'pon' THEN 'wage'
                WHEN HariJawa = 'wage' THEN 'kliwon'
                WHEN HariJawa = 'kliwon' THEN 'legi'
                WHEN HariJawa = 'legi' THEN 'pahing'
                WHEN HariJawa = 'pahing' THEN 'pon'
            END;

        -- Mengubah HariIndo berdasarkan siklus 7 hari
        SET HariIndo = 
            CASE
                WHEN HariIndo = 'Minggu' THEN 'Senin'
                WHEN HariIndo = 'Senin' THEN 'Selasa'
                WHEN HariIndo = 'Selasa' THEN 'Rabu'
                WHEN HariIndo = 'Rabu' THEN 'Kamis'
                WHEN HariIndo = 'Kamis' THEN 'Jumat'
                WHEN HariIndo = 'Jumat' THEN 'Sabtu'
                WHEN HariIndo = 'Sabtu' THEN 'Minggu'
            END;

        -- Memeriksa apakah waktuMulai melebihi waktuSelesai
        IF DATEDIFF(waktuMulai, waktuSelesai) > 0 THEN
            LEAVE mulaiLoop;  -- Keluar dari loop jika waktuMulai sudah lebih dari waktuSelesai
        END IF;

      
    END LOOP mulaiLoop;
END$$

